import React from 'react';
import classes from "./Products.module.css";
import extraClass from "../components/MainHeader.module.css";
import { Link } from 'react-router-dom';

function Products() {
    return (
        <section className={classes.topSection}>
            <h1 className={extraClass.header}>Products Selling Page</h1>

            <ul style={{listStyle: "none", textDecoration: "none", color: 'white'}}>
                <li style={{color: "white", textDecoration: "none", background: "white", textAlign: "center" , width: "100px", margin: "0 auto", borderRadius: "5px" , marginBottom: "10px"}}>
                    <Link to="/products/paints" > Paints</Link>
                </li>
                <li style={{color: "white", textDecoration: "none", background: "white", textAlign: "center" , width: "100px", margin: "0 auto", borderRadius: "5px", marginBottom: "10px"}}>
                    <Link to="/products/shirts">Shirts </Link>
                </li>
                <li style={{color: "white", textDecoration: "none", background: "white", textAlign: "center" , width: "100px", margin: "0 auto", borderRadius: "5px", marginBottom: "10px"}}>
                    <Link to="/products/T-shirts">T-shirts</Link>
                </li>
            </ul>
        </section>
    )
}

export default Products;
